import './App.css'
import React, { Component } from "react";
import { CardColumns, Card, Button, ListGroup } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import DeleteIcon from '@material-ui/icons/Delete';
import { ListItemIcon } from '@material-ui/core';
import { StayPrimaryPortraitSharp } from '@material-ui/icons';

export default class DisplayList extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
        };
    }

    playlistCard = item =>{
        return(
            <ListGroup.Item>{item.title}</ListGroup.Item>
        )
    }

    render() {
        return (
            <div>
                <ListGroup>
                {(this.props.list.length > 0) ? this.props.list.map(item => { return this.playlistCard(item) }) : "No Songs in Playlist"}
                </ListGroup>
            </div>
        )
    }
}
